import './App.css';
import { Routes, Route } from 'react-router-dom';
import Headers from './components/header/Headers';
import Footer from './components/footer/footer';
import Login from './pages/Login';

function App() {
  return (

      <Routes>
        <Route path='/login'>
          <Login />
        </Route>
        <Headers />
      </Routes>

  );
}

export default App;
